    return(
      <React.Fragment>
         <Container fluid className="centered">
      <Navbar dark color="dark">
        <NavbarBrand href="/">My React App</NavbarBrand>
      </Navbar>

        <Row>
          <Navbar col-md-2 d-none d-md-block bg-light className="sidebar">
            adaaaaaaaaaaaaaaaaaaaaaaa
